import React from "react"
import { Link } from "react-router-dom";
function HomePage() {
    return (
      <div className="HomePage">
        <h1>Welcome to Tic Tac Toe</h1>
        <div>
          <Link to="/single">
            <button className="btn btn-primary">Play Single Device</button>
          </Link>
          <Link to="/multi">
            <button className="btn btn-secondary">Play Multi Device</button>
          </Link>
        </div>
      </div>
    );
  }


export default HomePage
